import * as React from 'react';
import styled from 'styled-components';

export const GridWrapper = styled.div`
  display: block;
  background: red;
`;
const gutter = props.gutter ? props.gutter : '20';

const Grid = (props) => {
  return (
    <GridWrapper>
      {props.children}
    </GridWrapper>
  )
}

export default Grid
